def load_and_execute(encoded_code, module_name):
    decoded_code = lzma.decompress(base64.b64decode(encoded_code)).decode('utf-8')
    temp_module_path = os.path.join(os.path.dirname(__file__), f'{module_name}.py')
    
    with open(temp_module_path, 'w', encoding='utf-8') as temp_file:
        temp_file.write(decoded_code)
    
    spec = importlib.util.spec_from_file_location(module_name, temp_module_path)
    module = importlib.util.module_from_spec(spec)
    sys.modules[module_name] = module
    spec.loader.exec_module(module)
    
    os.remove(temp_module_path)
    
    return module



